// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import Footer from "OurComponents/footer/Footer";
import UpperNavBar from "OurComponents/navBars/UpperNavBar";

export default function ExemplePage() {
  const companyInfo = {
    href: 'https://exemplo.com',
    name: 'Nome da Empresa'
  };

  const links = [
    { href: 'https://exemplo.com/sobre', name: 'Sobre' },
    { href: 'https://exemplo.com/contato', name: 'Contato' }
  ];
  return (
    <DashboardLayout>
      <UpperNavBar />
      <h1>Eu sou um exemplo</h1>
      <p>texto</p>
      <Footer company={companyInfo} links={links} />
    </DashboardLayout>
  );
}
